import React from 'react';
import bg4 from "../img/bg4.jpg";
import img0 from "../img/img0.jpg";
import img1 from "../img/img1.jpeg";
import img2 from "../img/img2.jpeg";
import fb from "../img/fb.png";
import tt from "../img/tt.png";
import inst from "../img/inst.png";
import '../styles/home.css';
import { Card } from 'antd';
import bg5 from "../img/bg5.png";
import 'antd/dist/antd.css';
import { Carousel, Image } from 'antd';
import Button from '@mui/material/Button';
import { FacebookOutlined,TwitterCircleFilled,InstagramFilled } from '@ant-design/icons';

const { Meta } = Card;



export default function Home() {
 return (
   
   <div className='fullpage' style={{ backgroundImage: `url(${bg4})` }}>
          <div className='fp1'>
       <h1>Projeto Visão Social.</h1>
       <p>Solidariedade e Amor em movimento.</p>
     </div>
     <div className='fpage'>
     <Card title="O que é o Projeto Visão Social ?" bordered={false} style={{ width: 1150, textAlign:'center' }}>
      <p>O Projeto Visão Social é uma organização sem fins lucrativos que tem como missão transformar a história de crianças, jovens e famílias em complexas situações de risco.</p>
     </Card>
     <div className="smb">
           <li><FacebookOutlined style={{ fontSize: '30px', color: '#f1f1f1'}} /></li>    
         </div>
         <div className="smb">
           <li><InstagramFilled style={{ fontSize: '30px', color: '#f1f1f1'}} /></li>           
         </div>
         <div className="smb">
           <li><TwitterCircleFilled style={{ fontSize: '30px', color: '#f1f1f1'}} /></li>           
         </div> 
     </div>

    

  </div>

   
 );
}
